import React from "react";

export default function Card(props){
  console.log(props.openSpots)
  return(
    <div className="card">
      <img src={`../images/${props.img}`} className="card-image"/>
      {props.openSpots === 0 && <div className="sold">SOLD OUT</div>}
      <div> 
        <img src="./images/star 1.png" width={14}/> {props.rating}  <span className="six">({props.reviewCount}).{props.country}</span>
      </div>
      
      <p className="life">
        {props.title}
      </p>
      <p className="lifes">
        <span className="from">From ${props.price}</span> / person
      </p>

    </div>
  )

}
